function searchFilter(e,t){var s,r,n,a;for(s=document.getElementById(e).value.toUpperCase(),r=document.getElementById(t).getElementsByTagName("tr"),a=0;a<r.length;a++)(n=r[a].getElementsByTagName("td")[2])&&(n.innerHTML.toUpperCase().indexOf(s)>-1?r[a].style.display="":r[a].style.display="none")}document.querySelector("#searchUsers").addEventListener("keyup",()=>{searchFilter("searchUsers","tableUsers")});